import React from "react";

const HistoryItem = ({transaction}) => (
<li className="history__item history__item-plus">{transaction.description}
					<span className="history__money">{transaction}  ₽</span>
					<button className="history__delete"></button>
</li>

);

export default HistoryItem; 

/*

<li className="history__item  history__item-minus">
					Отдал долг
					<span className="history__money">-10000₽ </span>
					<button className="history__delete">x </button>
</li>

